from typing import List

class TopologicalParity:
    def __init__(self, pieces: List[int], colors: List[int]):
        self.n = len(pieces)
        self.pieces = pieces
        self.colors = colors
        self.dp = [[0 for _ in range(self.n)] for _ in range(self.n)]

    def helper(self, l: int, r: int, flag: int):
        if l > r:
            return 1
        if l == r:
            if flag == -1:
                return 1
            elif flag == 0:
                return 2
            else:
                return 3
        res = 0
        for i in range(l, r):
            if self.pieces[l] > self.pieces[i]:
                if self.colors[i] == flag:
                    res = (res + self.helper(l, i, -flag)) % 10 ** 9 + 10 ** 9
                else:
                    res = (res + self.helper(l, i, flag)) % 10 ** 9
            if self.pieces[r] > self.pieces[i]:
                if self.colors[i] == flag:
                    res = (res + self.helper(i, r, -flag)) % 10 ** 9 + 10 ** 9
                else:
                    res = (res + self.helper(i, r, flag)) % 10 ** 9
        return res

    def solution(self):
        for i in range(self.n):
            for j in range(self.n):
                if i == j:
                    self.dp[i][j] = 1
                else:
                    self.dp[i][j] = self.helper(i, j, 0)
                    self.dp[i][j] = self.dp[i][j] % 10 ** 9 + 10 ** 9
        return self.dp[0][self.n - 1]

