        self.cost = cost
        self.distance = distance


    def has_edge(self, x: int, y: int) -> bool:
        for e in self.edges:
            if e[0] == x and e[1] == y:
                return True
        return False

    def has_self_edge(self, x: int) -> bool:
        return self.has_edge(x, x)

    def is_connected(self):
        visited = [False] * self.n

        def dfs(node: int, visited: List[bool]):
            visited[node] = True

            for i in range(len(self.graph)):
                if self.graph[node][i]:
                    if not visited[i]:
                        dfs(i, visited)

        for i in range(len(visited)):
            if not visited[i]:
                dfs(i, visited)
                return visited

        return visited

    def get_distance(self, x: int, y: int) -> int:
        return self.distance[x][y]

    def get_weight(self, x: int, y: int) -> int:
        return self.cost[x][y]

    def get_shortest_distance(self, x: int, visited: List[bool]) -> int:
        if self.has_self_edge(x):
            return -1

        if visited[x]:
            return 0

        visited[x] = True
        min_distance = 0

        for i in range(len(self.graph)):
            if self.graph[x][i]:
                if not visited[i]:
                    distance = self.get_shortest_distance(i, visited)
                    if distance == -1:
                        continue
                    min_distance = max(min_distance, distance + self.get_weight(x, i))

        return min_distance

