from icontract import require, ensure, DBC


class Split(DBC):
    """Represent a split of integers."""

    @require(lambda first: first >= 1)
    @require(lambda ints: len(ints) >= 2)
    @require(lambda ints: all(isinstance(x, int) for x in ints))
    @require(lambda ints: sum(ints) <= 10 ** 9)
