        """Return whether the splits are equal."""
        return (
            self.first == other.first
            and self.ints == other.ints
        )

    def __lt__(self, other: Split) -> bool:
        """Return whether this split is less than the other one."""
        return (self.first, self.ints) < (other.first, other.ints)


class SplitProblem:
