    @staticmethod
    def splits(first: int) -> List[Split]:
        """Return a list of all possible splits of the given length."""
        ints = [first]
        for _ in range(1, ceil(self.n / first)):
            ints += [first] * (first + 1)

        return [
            Split(first=first, ints=ints[:first])
        ] + [
            Split(first=first + i, ints=ints[i: i + first])
            for i in range(1, first)
        ]

