class Solution3:
    """O(nlogn)"""
    def minHeight(self, n: int, k: int) -> int:
        dp = [math.inf] * (k+1)
        dp[0] = 0

        queue = deque()
        queue.append(n)

        while queue:
            i = queue.popleft()
            for j in range(k, 0, -1):
                dp[j] = min(dp[j], dp[j//2] + 1) if j % 2 == 1 else min(dp[j], dp[j-1] + 1)

                if j == 1:
                    queue.append(i - 1)
                    queue.append(i - 1)
                elif j % 2 == 0:
                    queue.append(i - 1)
                else:
                    queue.append(i)

        return dp[-1]

