public static int get_total_bases_and_rebels(int n, int m, int[][] map, int[][] enemies) {
    if (n <= 0 || m <= 0) {
        return -1;
    }

    int count = 0;

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            if (map[i][j]!= 0) {
                count++;
            }
        }
    }
    if (count < n) {
        return -1;
    }

    int[] dp = new int[count];
    int[] row = new int[m];
    int[][] matrix = new int[n][count];
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            if (map[i][j]!= 0) {
                matrix[i][j] = i;
            }
        }
    }

    int[] index = new int[n];
    int i = 0;
    for (int[][] row : enemies) {
        if (row.length == 0) {
            continue;
        }
        for (int j = 0; j < count; j++) {
            dp[j] = 0;
        }
        for (int j = 0; j < row.length; j++) {
            if (row[j] > i) {
                index[row[j]] = i;
                dp[i]++;
            }
        }
        i++;
    }

    boolean[][] visited = new boolean[n][count];
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < count; j++) {
            if (matrix[i][j] == i) {
                if (dp[j] <= 1) {
                    return -1;
                }
                visited[i][j] = true;
                for (int k = 0; k < count; k++) {
                    if (!visited[i][k] && matrix[i][k] == i) {
                        if (dp[k] > 1) {
                            dp[k] = 1;
                        }
                        visited[i][k] = true;
                    }
                }
            }
        }
    }
    for (int[] row : visited) {
        for (boolean visited : row) {
            if (!visited) {
                return -1;
            }
        }
    }
    return dp.length;
}
