class MinDistToB:
    def __init__(self, a: Point, b: Point):
        self.a = a
        self.b = b
        self.dist = dict()
        self.visited = set()
        self.max_dist = inf

    def __str__(self):
        return f'a={self.a}, b={self.b}, dist={self.dist}, visited={self.visited}, max_dist={self.max_dist}'

    def __repr__(self):
        return self.__str__()

    def update(self, dist: int) -> None:
        self.dist[self.b] = dist
        if dist < self.max_dist:
            self.max_dist = dist

    def in_bounds(self, x: int, y: int) -> bool:
        return 0 <= x < self.a.x and 0 <= y < self.a.y

    def walk(self, p: Point) -> None:
        if p in self.visited:
            return
        self.visited.add(p)
        x, y = p.x, p.y
        dist = self.dist[p] if p in self.dist else 0
        for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            x1 = x + dx
            y1 = y + dy
            if not self.in_bounds(x1, y1):
                continue
            if (x1, y1) not in self.dist:
                self.dist[(x1, y1)] = dist + 1
            self.walk((x1, y1))

    def solve(self) -> int:
        self.walk(self.a)
        return self.max_dist

