            nodes.append(node.value)
            node = node.next
        nodes.append('None')
        return'-> '.join(str(n) for n in nodes)

    def push_front(self, value: int) -> None:
        new_node = Node(value)
        new_node.next = self.head
        self.head = new_node
        if self.tail is None:
            self.tail = self.head

    def push_back(self, value: int) -> None:
        new_node = Node(value)
        if self.head is None:
            self.head = new_node
            return
        self.tail.next = new_node
        self.tail = new_node

    def pop_front(self) -> None:
        if self.head is None:
            return
        if self.head.next is None:
            self.head = None
            self.tail = None
            return
        second_head = self.head.next
        self.head = second_head
        second_head.next = None

    def pop_back(self) -> None:
        if self.head is None:
            return
        if self.head.next is None:
            self.head = None
            self.tail = None
            return
        node = self.head
        while node.next.next is not None:
            node = node.next
        tail = node
        node.next = None
        self.tail = tail

    def remove(self, value: int) -> None:
        if self.head is None:
            return
        if self.head.next is None:
            if self.head.value == value:
                self.head = None
                self.tail = None
            return
        if self.head.value == value:
            self.pop_front()
            return
        node = self.head
        while node.next is not None:
            if node.next.value == value:
                break
            node = node.next
        if node.next is None:
            return
        node.next = node.next.next
        node.next.next = None
        if node.next is None:
            self.tail = node

    def insert(self, index: int, value: int) -> None:
        if index == 0:
            self.push_front(value)
            return
        if self.head is None:
            self.push_back(value)
            return
        new_node = Node(value)
        node = self.head
        prev_node = self.head
        for i in range(index - 1):
            prev_node = node
            node = node.next
            if node is None:
                break
        if node is None:
            self.push_back(value)
            return
        if node.next is None:
            self.tail = new_node
        new_node.next = node
        prev_node.next = new_node
        node.next = node.next.next

