        length = end - start
        mid = start + length // 2
        self.numberOfInversionsHelper(start, mid)
        self.numberOfInversionsHelper(mid + 1, end)
        self.mergeAndCountInversions(start, mid, end)

    def mergeAndCountInversions(self, start, mid, end):
