from collections import defaultdict


class Solution:
    def __init__(self):
        self.cache = {}

    def calc_bombs(self, field):
        bombs = defaultdict(int)
        for row in range(len(field)):
            for col in range(len(field[row])):
                if field[row][col] == '*':
                    bombs[(row, col)] = 1

        return bombs

    def find_squares(self, bombs, x, y):
        if bombs[(x, y)] > 0:
            return bombs[(x, y)]

        squares = 0
        for row in range(x - 1, x + 2):
            for col in range(y - 1, y + 2):
                if (row, col) in bombs:
                    squares += bombs[(row, col)]

        return squares

    def find_empty(self, field):
        empty = []
        for row in range(len(field)):
            for col in range(len(field[row])):
                if field[row][col] == '?':
                    empty.append((row, col))

        return empty

    def count_ways(self, field, bombs):
        squares = []
        empty = self.find_empty(field)
        for (x, y) in empty:
            squares.append((x, y, self.find_squares(bombs, x, y)))

        return squares

    def solve_0(self, field):
        bombs = self.calc_bombs(field)
        squares = self.count_ways(field, bombs)
        return squares

    def solve_1(self, field):
        bombs = self.calc_bombs(field)
        squares = self.count_ways(field, bombs)
        bombs = self.calc_bombs(field)
        ways = 1
        for x, y, n in squares:
            ways *= (n + 1)
        return ways % 1000000007

    def solve(self, stdin: str) -> str:
        """
        Brute force
        """
        if stdin in self.cache:
            return self.cache[stdin]

        bombs = self.calc_bombs(stdin)
        n = len(stdin)
        n_ways = 1
        squares = self.count_ways(stdin, bombs)
        for x, y, n in squares:
            n_ways *= (n + 1)
        self.cache[stdin] = n_ways % 1000000007
        return n_ways

