import itertools

class Node:
    def __init__(self, data):
        self.data = data
        self.previous = None
        self.next = None

    def __str__(self):
        return self.data

class LinkedList:
    def __init__(self, data):
        self.head = Node(data)
        self.tail = self.head

    def add(self, data):
        node = Node(data)
        self.tail.next = node
        node.previous = self.tail
        self.tail = node

    def delete(self, data):
        for node in self.iterate():
            if node.data == data:
                node.previous.next = node.next
                node.next.previous = node.previous
                return

    def iterate(self):
        current = self.head
        while current is not None:
            yield current
            current = current.next

    def __str__(self):
        ret = []
        current = self.head
        while current is not None:
            ret.append(current.data)
            current = current.next
        return str(ret)

